import React, { Component } from 'react';
import { connect } from 'react-redux';


class NoteList extends Component {
  constructor(props) {
    super(props);
      this.state={
        ary:[]
      }
    }

  componentWillMount(){
    this.setState({
      ary: this.props.ary
    })
  }

  getObj(event){
    const { param } = event.target.dataset;
    console.log(JSON.stringify(param));
    console.log(event)
  }
  render() {
    return (
      <div>
      {JSON.stringify(this.props)}
      {
        this.props.ary.map(res=>(
          <h1 data-param={res} onClick={this.getObj}>{res.title}</h1>
        ))
      }
      </div>
    );
  }
}

const reciver = (state)=>{
  return{
    ary: state.ary
  }
}

export default connect(reciver)(NoteList);
